webpackJsonp([34253048878726],{5153:function(e,t){e.exports={data:{post:{html:"<p>Christopher's fever is gone. His appetite his back but not yet normal. The doctors are concerned with his blood gas... it's too alkaline, but may not be directly related to the pneumonia. They're taking urine samples to check his kidney function.</p>\n<p>No word yet on when he might be able to come home. They said 10 days when he was admitted, so that means next Tuesday.</p>\n<p>Mama's getting bored. She's asked for relief tomorrow afternoon, even though I'm not quite healthy yet. I'll bring my Palm, and try out the <a href=\"http://www.landware.com/gotype/classic.html\">GoType keyboard</a> I got in the States. Maybe I can get some writing done.</p>",fields:{title:"This late word",date:"24 Oct 2000",url:"https://papascott.de/2000-10-24-this-late-word/"}}},pathContext:{slug:"/2000-10-24-this-late-word/",prev:{fields:{title:"Just to see you again",date:"23 Oct 2000",slug:"/2000-10-23-just-to-see-you-again/"}},next:{fields:{title:"Every day in every way",date:"25 Oct 2000",slug:"/2000-10-25-every-day-in-every-way/"}}}}}});
